import React from "react";
import { HStack, Button, Image, Link } from "@chakra-ui/react";

import LargeLogo from "./assets/logo-full-large.svg";

function MenuBar() {
  return (
    <HStack>
      <Image src={LargeLogo} />
      <HStack></HStack>
    </HStack>
  );
}

export default MenuBar;
